import "./App.css";
import logoGif from "./moneyrooklogo.gif";

function App() {
  return (
    <div className="App">
      <h1 className="MoneyrookLogo">
        <img src={logoGif} alt="" length={190} width={175}></img>
      </h1>
    </div>
  );
}

export default App;
